import FooterMenuStyle from './footerMenu.module.css'
import React from 'react'
const Footer__menu=()=>{
    return(

          <div className={FooterMenuStyle.Footer__menu}>
      <a href='#'>Menu</a>
      <a href='#'>Exit</a>
      <a href='#'>Kselix</a>
      <a href='#'>Help</a>
      </div>

    )
}

export default Footer__menu
